// The Tweet type:
//
// Receive an object of type Tweet, but without methods and extend it with the
// appropriate methods, returning the resulted object.
//
// function toTweet(tweet: Tweet): Tweet
function toTweet(tweet) {

	// Extending the object with methods.

	//
	// id    (used for identifying tweets).
	//
	// hasId(): Boolean
	tweet.hasId = function() {
		return (tweet.hasOwnProperty('id') && tweet.id !== null &&
			tweet.id !== 0);
	}
	// getId(): Int
	tweet.getId = function() {
		return tweet.id;
	}


	//
	// created_at    (creation date and time).
	//
	// hasCreatedAt(): Boolean
	tweet.hasCreatedAt = function() {
		return (tweet.hasOwnProperty('created_at') && tweet.created_at !== null
			&& tweet.created_at !== "");
	}
	// Convert tweet.created_at to a time object.
	// Example: tweet.created_at = "Mon Mar 14 12:55:01 +0000 2016".
	// TODO: Timezone?
	if(tweet.hasCreatedAt()) {
		// Only create a date object if the .created_at is set.
		var year = tweet.created_at.substr(26, 4);
		var month_string = tweet.created_at.substr(4, 3);
		var month = "JanFebMarAprMayJunJulAugSepOctNovDec"
			.indexOf(month_string) / 3 + 1;
		var day = tweet.created_at.substr(8, 2);
		var hours = tweet.created_at.substr(11, 2);
		var minutes = tweet.created_at.substr(14, 2);
		var seconds = tweet.created_at.substr(17, 2);
		var milliseconds = 0;  // Cannot be retrieved - also don't care.

		// Create the date object.
		var created_at_date = new Date(year, month, day, hours, minutes,
			seconds, milliseconds);
		// console.log(year + " " + month + " " + day + " " + hours + " " + 
			// minutes + " " + seconds + " " + milliseconds);
	}
	// getCreatedAt(): Date
	tweet.getCreatedAt = function() {
		return created_at_date;
	}


	//
	// text    (the text of the tweet).
	//
	// hasText(): Boolean
	tweet.hasText = function() {
		return (tweet.hasOwnProperty('text') && tweet.text !== null
			&& tweet.text !== "");
	}
	// getText(): String
	tweet.getText = function() {
		return tweet.text;
	}


	// 
	// geo
	//
	// TODO: polygon type.
	// hasLocation(): Boolean
	tweet.hasLocation = function() {
		return (tweet.hasOwnProperty('geo') && tweet.geo !== null &&
			tweet.geo.hasOwnProperty('type') && tweet.geo.type === "Point");
	}
	// getLocation(): Array[Float]  (array with 2 elements).
	tweet.getLocation = function() {
		return tweet.geo.coordinates;
	}


	//
	// result_type    ("popular" or "recent").
	//
	// hasResultType(): Boolean
	tweet.hasResultType = function() {
		return (tweet.hasOwnProperty('metadata') && 
			tweet.metadata.hasOwnProperty('result_type') &&
			(tweet.metadata.result_type === "popular" ||
			tweet.metadata.result_type === "recent"));
	}
	// getResultType(): String - "popular" or "recent"
	tweet.getResultType = function() {
		return tweet.metadata.result_type;
	}


	//
	// retweet_count    (number of retweets).
	//
	// hasRetweetCount(): Boolean
	tweet.hasRetweetCount = function() {
		return (tweet.hasOwnProperty('retweet_count') &&
			tweet.retweet_count !== null && tweet.retweet_count !== "");
	}
	// getRetweetCount(): Int
	tweet.getRetweetCount = function() {
		return tweet.retweet_count;
	}


	//
	// favorite_count    (number of users who added this tweet to favorites).
	//
	// hasFavoriteCount(): Boolean
	tweet.hasFavoriteCount = function() {
		return (tweet.hasOwnProperty('favorite_count') &&
			tweet.favorite_count !== null && tweet.favorite_count !== "");
	}
	// getFavoriteCount(): Int
	tweet.getFavoriteCount = function() {
		return tweet.favorite_count;
	}


	// Instead of having the methods hasHashtags, you can call this and get an
	// empty array if there are no hashtags in the text.
	//
	// hashtags    (hashtags from the text).
	//
	// getHashtags(): Array[String]
	tweet.getHashtags = function() {
		var hashtags = new Array();

		// Check if hashtags field is set.
		if(!tweet.hasOwnProperty('entities') ||
			!tweet.entities.hasOwnProperty('hashtags') ||
			tweet.entities.hashtags === null)
			return hashtags;  // Return an empty array.

		for(var i = 0; i < tweet.entities.hashtags.length; ++i)
			hashtags[i] = tweet.entities.hashtags[i].text;

		return hashtags;
	}


	//
	// user    (the user who posted the tweet).
	//
	tweet.user = toUser(tweet.user);




	// TODO: other fields for a tweet.
	// 
	// Other fields of a tweet that might be useful: geo, co-ordinates, place,
	// contributors?, user_mentions, urls, in_reply_to_user_id,
	// in_reply_to_status_id.

	return tweet;
}









